import React from 'react';
import Footer from '../../components/Footer';
import Header from '../../components/Header';
import UserDescription from '../../components/UserDescription';

import './styles.css';

import Star from '../../assets/star.svg';


function Profile() {
  return (
    <div className="content">
      <Header />
      <div className="profile">
        <UserDescription />
        <div className="repository-cards">
          <div className="repository-card">
            <h1>Repository Name</h1>
            <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed tincidunt congue ligula in rutrum. Morbi nec lacus condimentum...</p>
            <div>
              <div>
                <img alt="Star"/>
                <span>100 stars</span>
              </div>
              <div>
                <img alt="Last time updated"/>
                <span>Updated 30 days ago</span>
              </div>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default Profile;
